  description:
    '<span style="color:#000000;"><span style="font-size:16px;"></span><span style="font-size:20px;"><strong>Features:</strong></span><span style="font-size:16px;"><br>\n<strong>Hyper Stream II &amp;8-Channel Internal Quad DAC </strong><br>\nThe ES9038PRO DAC incorporates the latest 32bit Hyper Stream II technology from ESS, delivering the best dynamic range in the industry and a highly-pure sound by realizing an extremely-low THD+N value even at low-amplitude signals. An 8-channel internal quad-DAC separates the eight channels for precise sound control, and each channel is converted via the four internal DACs to deliver a clear, noise-canceled signal so that you can enjoy a perfect sound close to the original source.<br>\n<br>\n<strong>Rich, Clear Sound via High-Quality 4.4mm Balanced Output</strong><br>\nThe PLENUE L uses 4.4mm balanced output to reproduce crisp original sounds.The 4.4mm balanced output, the new standard in high-fidelity audio, supports richer output than the conventional 3.5mm unbalanced output. Greater left-right channel separation prevents crosstalk between left and right audio signals to deliver a very clear, realistic sound without distortion or loss. Balanced output effectively blocks noise generated when signals are transmitted by adding \'out of phase\' signals to unbalanced output signals. Since it transmits two types of signals simultaneously, the PLENUE L strengthens the output signal for clearer and crisper reproduction of original sound. <br>\n<br>\n<strong>The World\'s Best Audio Quality</strong><br>\nThe amazing specifications of the PLENUE L include SNR 128dB, THD+N 0.0004%, Stereo Crosstalk -144dB, and Balanced Output 4.05Vrms which are the result of our decades of audio experience and passion for perfection. <br>\n<br>\n<strong>Faithful to Original Sound Support Native DSD up to DSD256</strong><br>\nDSD(Direct Stream Digital) is a high quality Super Audio CD format that processes signals at 2.8224MHz per bit. The technology carries the maximum sound information possible to reproduce the delicate and crisp sound of analog. To realize the best possible sound quality, the PLENUE L reproduces DSD in Native method without PCM conversion and supports DSD256(Quad rate DSD), the highest frequency among all DSD formats.<br>\n<br>\n<strong>High-Gloss, High-Strength Hybrid Metal Alloy Micro Polish Alloy Metal</strong><br>\nThe PLENUE L boasts a hybrid metal alloy body reinforced with high-strength materials and heat treatment that is precision-machined via CNC. Its high-gloss finish, a visualization of the magnificent sound of brass instruments, is realized through experts in special micro-polishing (buffing) and anodizing to match the high sound quality with equally premium materials.</span><br>\n<br>\n<br>\n<span style="font-size:20px;"><strong>Specification:</strong></span><span style="font-size:16px;"><br>\nModel Name:PLENUE L<br>\nProduct Capacity:Built-in Memory: 256GB / External Memory : microSD SDXC<br>\nDisplay:3.7” AMOLED Touch Display (480x800)<br>\nDimensions &amp; Weight:67.9mm(W) x 119.1mm(H) x 16.5mm(D) / 199g<br>\nCase:Micro Polish Alloy Metal &amp; Carved Glass<br>\nButtons:POWER, PLAY/PAUSE, FF, REW, Multi Button, Multi Wheel, Volume Wheel<br>\nCPU:ARM Cortex A9 1.2GHz Dual-Core<br>\nFile Formats:DXD / DSD(DFF, DSF, ISO) / FLAC / WAV / AIFF / ALAC / APE / MP3 / WMA / OGG / WV / TTA / DCF<br>\nTrack Information:CUE sheet, SACD ISO (2Ch)<br>\nLyrics:LRC, LDB, Lyrics3, ID3 Tag Lyrics (Time Information Yes/No)</span><br>\n<br>\n<br>\n<span style="font-size:20px;"><strong>Audio Characteristics</strong></span><span style="font-size:16px;"><br>\nDAC:ES9038PRO<br>\nSNR: 125dB Unbalance / 128dB Balance<br>\nTHD+N: 0.0004% Unbalance / 0.0005% Balance (24bit, 32bit)<br>\nStereo Crosstalk: -133dB Unbalance / -144dB Balance<br>\nOutput: 2.1Vrms Unbalance / 4.0Vrms Balance<br>\nOutput Impedance: 0.9Ω Unbalance / 1.8Ω Balance<br>\nVolume: 140 Levels<br>\nClock: Precision Clock Dual TCXO (Phase Jitter 1.0ps)<br>\n<br>\n<strong>System Requirement</strong><br>\nCPU Pentium lll 500MHz or higher<br>\nOS: Windows 10 / 8 / 7 / Vista / XP / 2000 / ME : All functions supported<br>\nMAC OS 10.x / Linux v2.4 or higher : File transfer supported<br>\nUSB Port: 2.0 High Speed (recommended)</span></span>',
